import React, {useState} from "react";
import PropTypes from "prop-types";
import SwipeableViews from "react-swipeable-views";
import { useTheme } from "@mui/material/styles";
import AppBar from "@mui/material/AppBar";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import { TextField } from "@mui/material";
import { Button } from "@mui/material";
import './style.css'
import MAskedInput from "../Maskinput";
function TabPanel(props) {
  let valor ='';
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`full-width-tabpanel-${index}`}
      aria-labelledby={`full-width-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ p: 3 }}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.number.isRequired,
  value: PropTypes.number.isRequired
};

function a11yProps(index) {
  return {
    id: `full-width-tab-${index}`,
    "aria-controls": `full-width-tabpanel-${index}`
  };
}

export default function FullWidthTabs() {
  const theme = useTheme();
  const [value, setValue] = useState(0);
  const [weight, setHeight] = useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const handleChangeIndex = (index) => {
    setValue(index);
  };
  const handleInputChange = (evento) => {
    console.log(evento.target.value);
  };

  const handleWeight = (e) => {
    setHeight(e.target.value)
  }

  return (
    <Box sx={{ bgcolor: "background.paper", width: '100%' }}>
      <AppBar position="static">
        <Tabs
          value={value}
          onChange={handleChange}
          indicatorColor="secondary"
          textColor="inherit"
          variant="fullWidth"
          aria-label="full width tabs example"
        >
          <Tab label="Itens do Frete" {...a11yProps(0)} />
          <Tab label="Notas Fiscais" {...a11yProps(1)} />
        </Tabs>
      </AppBar>
      <SwipeableViews
        axis={theme.direction === "rtl" ? "x-reverse" : "x"}
        index={value}
        onChangeIndex={handleChangeIndex}
      >
        
        <TabPanel value={value} index={0} dir={theme.direction}>
          <div className="primeirapart">
            <TextField sx={{ m: 1, width: "30%" }} id="outlined-read-only-input" label="Total Volume" InputProps={{readOnly: true,}}/>
            <TextField sx={{ m: 1, width: "30%"}} id="outlined-read-only-input" label="Total Cubagem" InputProps={{readOnly: true,}}/>
            <TextField sx={{ m: 1, width: "30%" }} id="outlined-read-only-input" label="Total Peso Real" InputProps={{readOnly: true,}}/>
            
          </div> 
          <div className="segundapart">
            <TextField sx={{ m: 1,width:'12%'}}onChange={handleInputChange} required id="outlined-required" label="Cód Frete"/>
            <TextField sx={{m: 1,width:'30%'}}onChange={handleInputChange} required id="outlined-required" label="Descrição da Carga"/>
            <Button    sx={{m: 1,width:'8%'}} variant="outlined">Buscar</Button>
            <TextField sx={{m: 1,width:'30%'}}onChange={handleInputChange} required id="outlined-required" label="Tipo de Volume"/>
            <Button sx={{m: 1,width:'8%'}} variant="outlined">Buscar</Button>
          </div>
          <div className="terceipart">
            <TextField sx={{ m: 1, width: "15%" }}onChange={handleInputChange}requiredid="outlined-number"label="Qtd Vol"type="text"InputLabelProps={{shrink: true}}/>
            <TextField sx={{ m: 1, width: "15%" }}onChange={handleInputChange}requiredid="outlined-number"label="Altura"type=" text"InputLabelProps={{shrink: true}}/>
            <TextField sx={{ m: 1, width: "15%" }}onChange={handleInputChange}requiredid="outlined-number"label="Largura"type="text"InputLabelProps={{shrink: true}}/>
            <TextField sx={{ m: 1, width: "15%" }}onChange={handleInputChange}requiredid="outlined-number"label="comprimento"type="text"InputLabelProps={{shrink: true}}/>
            <TextField sx={{ m: 1, width: "15%" }}onChange={handleInputChange}requiredid="outlined-number"label="Peso Cubado"type="text"InputLabelProps={{shrink: true}}/>
            <TextField sx={{ m: 1, width: "15%" }}onChange={handleInputChange}requiredid="outlined-number"label="Peso Real"type="text"InputLabelProps={{shrink: true}}/>
          </div> 
        </TabPanel>

        <TabPanel value={value} index={1} dir={theme.direction}>
          <div className="quartapart">
            <TextField sx={{ m: 1,width:'11%'}}onChange={handleInputChange} required id="outlined-required" label="Cód Frete"/>
            <TextField sx={{m: 1,width:'19%'}}onChange={handleInputChange} required id="outlined-required" label="Chave da Nota Fiscal"/>
            <Button    sx={{m: 1,width:'8%'}} variant="outlined">Buscar</Button>
            <TextField sx={{m: 1,width:'8%'}}onChange={handleInputChange} required id="outlined-required" label="Nº NF"/>
            <TextField sx={{m: 1,width:'20%'}}onChange={handleInputChange} required id="outlined-required" label="CNPJ Remetente"/>
            <TextField sx={{m: 1,width:'20%'}}onChange={handleInputChange} required id="outlined-required" label="CNPJ Destino"/>
          </div>
          <div className="quintapart">
            <TextField sx={{m: 1,width:'30%'}}onChange={handleInputChange} required id="outlined-required" label="Valor"/>
            <Button    sx={{m: 1,width:'8%'}} variant="outlined">Anexar</Button>
            <Button    sx={{m: 1,width:'50%'}} variant="outlined">Atualizar</Button>
          </div>
        </TabPanel>
      </SwipeableViews>
    </Box>
  );
}
